def parse_reference_data(data):
    """
    递归解析引用型数据
    data: 原始列表数据
    返回: 完全解析后的数据
    """
    cache = {}  # 缓存已解析的结果

    def resolve(index, visited=None):
        """
        递归解析索引
        index: 索引值
        visited: 防止循环引用的访问记录
        """
        if visited is None:
            visited = set()

        # 检查缓存
        if index in cache:
            return cache[index]

        # 防止循环引用
        if index in visited:
            return {"__circular_ref": index}
        visited.add(index)

        # 获取原始值
        if not isinstance(index, int) or index < 0 or index >= len(data):
            return index

        value = data[index]

        # 处理列表
        if isinstance(value, list):
            # 处理特殊标记 ['ShallowReactive', 1]
            if len(value) == 2 and isinstance(value[0], str) and value[0] in ['ShallowReactive', 'Reactive', 'Set']:
                marker, ref = value
                resolved = resolve(ref, visited)
                result = {
                    "__type": marker,
                    "__ref": ref,
                    "__value": resolved
                }
            else:
                # 递归处理普通列表
                result = []
                for item in value:
                    if isinstance(item, int) and 0 <= item < len(data):
                        result.append(resolve(item, visited.copy()))
                    else:
                        result.append(item)

        # 处理字典
        elif isinstance(value, dict):
            result = {}
            for key, val in value.items():
                if isinstance(val, int) and 0 <= val < len(data):
                    result[key] = resolve(val, visited.copy())
                else:
                    result[key] = val

        # 处理其他类型
        else:
            result = value

        # 缓存结果
        cache[index] = result
        return result

    # 解析整个数据结构
    result = []
    for i in range(len(data)):
        result.append(resolve(i))

    return result



def merge(data):
    cache = {}
    def m(items, deep=0):
        new_deep = deep + 1
        t = dict()
        if isinstance(items, list):
            return [m(v, new_deep) for v in items]
        elif isinstance(items, str) or isinstance(items, int) or isinstance(items, float) or items is None:
            return items

        __type = items.get('__type', None)
        __value = items.get('__value', None)
        __ref = items.get('__ref', 0)
        if not __type:
            for k, v in items.items():
                t[k] = m(v, new_deep)
            return t
        if __type == "ShallowReactive" and __ref != 1:
            __type = "ShallowReactive" + str(items.get('__ref', "")) + str(deep)
        if isinstance(__value, dict):
            t[__type] = m(__value, new_deep)
        elif isinstance(__value, list):
            t[__type] = [m(v, new_deep) for v in __value]
        else:
            t[__type] = __value
        return t

    for i in data:
        try:
            cache.update(m(i))
        except ValueError:
            continue
        except TypeError:
            continue


    return cache


def paras_nuxt_data(html_content):
    soup = BeautifulSoup(html_content, "html.parser")
    scripts = soup.find("script", {"id": "__NUXT_DATA__"})
    data = json.loads(scripts.string)
    return merge(parse_reference_data(data))

